import React from 'react';
import Carousel from 'react-bootstrap/Carousel'




const Carousel$ = (props) => {

    const controls = props.UserPhotos.length === 1 ? false : false ;

    console.log(props.UserPhotos.length)

    return (
        <Carousel fade interval={null} indicators={false} controls={true} className='carousel-div'>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[0]} alt="First pict" />
            </Carousel.Item>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[1]} alt="Second pict" />
            </Carousel.Item>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[2]} alt="Third pict" />
            </Carousel.Item>

        </Carousel>
    )
}


export default Carousel$;
